import axios from 'axios'
import React, { Component } from 'react'

export default class Details extends Component {

constructor (props){
    super(props)

    this.state={
        allp:[]
    }
}

    componentDidMount(){
        axios(
          {
            url:"/product",
            baseURL:"http://127.0.0.1:8000/api",
            method:"get"
          }
         ).then((response)=>{
          console.log(response.data)
          this.setState({ allp:response.data })
         
         



         })
    
      }
      render() {
                const uls= this.state.allp.map((item)=>{
                    return ( <h1>{item.price}</h1> )                })

        return (
          <div><p>{this.state.allp.price }</p>
          {uls}   
          </div>


        )
      }
}
